import React from 'react';
import './App.css';

const albums = [
    {
        id : 1,
        name : 'Future Nostalgia',
        artist : 'Dua Lipa',
        image : '../../music_app/public/images/1.jpg'
    },
    {
        id : 2,
        name : 'From Midnight To Sunrise',
        artist : 'Crush',
        image : '../../music_app/public/images/2.jpg'
    },
    {
        id : 3,
        name : 'Miss Anthropocene',
        artist : 'Grimes',
        image : '../../music_app/public/images/3.jpg'
    }
]

class Album extends React.Component {
    render() {
        return (
            <center>
                <div>
                    <h2>
                        {this.props.id}번째 Album : {this.props.name}
                    </h2>
                    <h3>
                        Artist : {this.props.artist}
                    </h3>
                    <img src = {this.props.image} alt = {this.props.name}/>
                </div>
            </center>
        );
    }
}

class App extends React.Component {
    render() {
        return (
            <div>
                <center>
                    <h1>
                        대중 음악의 이해
                    </h1>
                    <h2>
                        정기 음평회
                    </h2>
                </center>

                {albums.map( album => {
                    return <Album 
                        key = {album.id}
                        id = {album.id}
                        name = {album.name}
                        artist = {album.artist}
                        image = {album.image}
                    />
                })}
            </div>
        );
    }
}

export default App;
